"use strict";let BaseURL=window.location.origin;document.getElementById("form-recuperacion").addEventListener("submit",async e=>{e.preventDefault();try{ShowPreloader();let e=await axios({url:"/default/recuperacion",baseURL:BaseURL,method:"POST",headers:{"X-CSRF-TOKEN":document.head.querySelector("[name~=csrf-token][content]").content},data:{CorreoElectronico:document.getElementById("correo-electronico").value}});HidePreloader();let a=e.data;switch(a.code){case 200:Swal.fire({title:"Recuperación de credenciales",text:a.data,imageUrl:window.HappyOwl,imageWidth:100,imageHeight:123,imageAlt:"Alert Image",background:"#000000",color:"#FFFFFF"});break;case 500:Swal.fire({title:"¡Error!",text:a.data,imageUrl:window.SadOwl,imageWidth:100,imageHeight:123,background:"#000000",color:"#FFFFFF",imageAlt:"Error Image"});break;default:Swal.fire({title:"¡Alerta!",text:a.data,imageUrl:window.IndifferentOwl,imageWidth:100,imageHeight:123,imageAlt:"Alert Image",background:"#000000",color:"#FFFFFF"})}}catch(e){HidePreloader(),Swal.fire({title:"¡Error!",text:e,imageUrl:window.SadOwl,imageWidth:100,imageHeight:123,background:"#000000",color:"#FFFFFF",imageAlt:"Error Image"})}});